(14, 2, 31, 5, '2016-07-16 12:07:00', 'The Meeting was held on 16th Jily 2016, for the issue of the Contract signing\r\nWith all we have discussed from the Company, there are somethings seems to be challenge, on the side of the Employee and i didnt give them any answer until to know the Management insights.\r\n1. Working Hours per day is 8hrs, so they are asking is there any Overtime payments if he Hours exceed the normal hours?\r\n2. They complained on the Termination procedures, that i told them after the Contract all procedures will be followed.\r\n3. On Saturday they are working more that 5 hours, they request whether they can get Overtime payments\r\n4. Holly-days and Sundays they want to be paid double payments\r\n5. The Full amount agreed should be allocated in the Contract, because that is their agreements so no need to put Half of the amount\r\n6. Those who worked for the period before the Contracts wants to be paid first before signing the Contract.\r\nIn Addition t that, the Employees said they will not be able to sign the Contract if the Payment for the passed years will not being paid.\r\nSo can we advice them to find out on how to pay at least a small amount of Money so that the Employees will sign the contract.\r\nWe have to advice then about the NSSF deduction should be real 10%, so as to avoid future Disturbances .', 0, 0, 0, 0, 0, 0, 0, 0, 0, 'I need to know what the Management say concerning making those adjustments so that, we can finish the Contract job. '),
(17, 2, 31, 5, '2016-07-25 12:07:00', 'HONG YU STEEL CO LTD.\r\nI have communicated with Mr. Luanda and we set the Date to meet, which is on Wednesday at 9:00am at Kibaha\r\nSo i would like to go to make discussion with him to see whether we can get the effective solution on their NSSF issue.', 0, 0, 0, 0, 0, 0, 0, 0, 0, 'I would like also to request if i can get the Softy copy of the list for NSSF contribution that shows adjustment of 54,945,600/= sp as when i meet him  i can show him those adjustments. and from there we can see how we can convince him to agree on our proposal. '),
(19, 2, 31, 5, '2016-07-30 12:07:00', 'PREPARATION OF THE RULES AND REGULATIONS FOR THE SUNSHINE INDUSTRIAL CO. LIMITED, \r\nTHERE ARE SOME THINGS TO ADD AS SUGGESTED BY MS. AMY, AND I HAVE ALREADY MADE THOSE CHANGES, I WOULD LIKE TO REQUEST HELP IN CHINESE TRANSLATIONS FROM MADAM CANGLA.', 0, 0, 0, 0, 0, 0, 0, 0, 0, 'I think for the employee\'s coppies should be only two languages English and Swahili, and this was agreed by Ms. Amy, so after finishing we will divide that one for the management will be tree languages for Chinese to understand, but for Tanzania staffs will be Two languages/ '),
(20, 2, 31, 5, '2016-08-06 12:08:00', 'VISITING SUNSHINE INDUSTRIAL\r\n1. We have finished the Rule and regulation job and i have printed, Ms. Amy made the Chinese Translation\r\n2. I have to start reviewing the Employees contract expiring date, so that i can make a list for those who are supposed to renew\r\n3. Working on the Discipline of the Sales People, who requests Sick leave without submitting medical information, also other employees whose crontracts were not returned to the office. I will start with this job on Tuesday. ', 0, 0, 0, 0, 0, 0, 0, 0, 0, 'I talk to Ms. Amy and Laura, they are wondering between Anamaria and Me, who will be responsible for their issue, so they are saying this things is confusing, if will be 2 HRs. they want one of us to handover to fellow, so that it can remain with 1 HR. '),
(21, 10, 31, 5, '2016-09-19 12:09:00', 'We have visited KILUWA GROUP OF COMPANY in Mlandiazi, this is our New company.\r\n\r\nI and Mr. Msika had a Serious Meeting with the Management the Assistant General Manager and Chief Finance Manager. Discussing about rules and Regulations and other many things concerning Human Resources Management. In the Meeting we have Agreed to do the following things in starting solving Human Resources challengis.\r\n\r\n    1. Preparation of Rules and Regulations that will guide them in Human resources affairs\r\n    2. Making sure all employees have Guarantors and we will prepare guarantor forms \r\n    3. Amending some parts of the Contracts so as to put clear some Mistaken parts according to the law. \r\n    4. Preparation for the Seek sheet, to manage the leaving habit taking reason of going to the hospital \r\n    5.  And Making sure Management will exclude them selves in food provision to the Employees.\r\n    6. Preparation of Leave application forms for them. \r\n    7. Set procedures for Making Overtime or otherwise will create the Round figure per month as overtime for all employees \r\n\r\nHere is our observations, we have first prepare the Official letters to the Government authorities that we are expecting to start Production, so that we can be in a good ground to escape WCF penalt for late contributions.. them we prepare the WCF registration for the KILUWA COMPANY,  this has already discussed and they agreed\r\n\r\nAlso we have to prepare Employees psychology for the new changes, so that when we give them amendments should not get challenges. this is through meetings with them and making sure all procedures are atlest according to the law.\r\n\r\nMost important thing is to make sure we help KILUWA minimizing management cost and also they are on the legal safe side, to make them escaping future disturbances. \r\n\r\nWe have to make sure that, every time we visit or communicate with the HR for following feedbacks, and also if he get challenges we solve it as soon as Possible. ', 0, 0, 0, 0, 0, 0, 0, 0, 0, 'I am Requesting for the New HR, to have meal assurance '),
