(24, 10, 31, 5, '2016-09-21 12:09:00', 'DEAR SIR/ MADAM\r\n\r\nPlease refer to the Our Client Mr. Jimmy the Owner of Kinglion investment, concerning his House made, whose case started from the missing money amounted 1,000,000/-. \r\n\r\nI have discussed with Mr. Jummy and he said It was 30/8/216 when the money was missing and all people worried may be Aisha the House made is the one responsible. He was disappointed for the issue this is why he didnt want to work with her anymore. \r\n\r\nSo the August salary was paid at the Local Government office, on 5/09/2016 and lady wrote notification to receive the money. this was good but the issue arisen there was Mr. Jimmy said on the presence of Local government officer that he dont want her any more, because she has stolen the money. \r\n\r\nShe went to CHODAU the trade union, which they demanded the amount of 2646,000.00 as the Compensation for Unfair Termination, as they said the Termination was not according to the legal procedures.  \r\n\r\nThe Following was the Breck down.\r\n\r\n1. One Month Notice           180,000\r\n2. Leave of 2016                180,000\r\n3. Severance 3 years          126,000\r\n4. 12 month Compensation   2160,000\r\n\r\nI have discussed with them, Aisha (the House Made) said the security guard at home refused to allowe her in to go for work, and this is why she went t othe Local Government office. \r\n\r\nMy Views and what i have done is to defend the 12month Compensation that, the CHODAU has no power to issue order to the Employer to pay Compensation, otherwise it is the Power of Arbitration Commissioner after being satisfied with the Informations provided during the case. so we have agreed that i will go to advice mr. Jimmy to pay terminal Benefits as follows \r\n\r\n1. One Month Notice         180,000\r\n2. Leave of 2016              180,000\r\n3. Severance 3 years        126,000\r\n   Total of all                   486,000\r\n\r\n\r\n\r\nI have Adviced Mr. Erasto to try to explain it to Mr. Jimmy if is okay for Him to pay this amount i can prepare the Agreement to be signed after payments in the CHODAU office\r\n\r\nWith Regards \r\nHR Consultant', 0, 0, 0, 0, 0, 0, 0, 0, 0, 'I have seen this the Following, She didnt have any contract since she starts Working with Mr. Jimmy, and she has never went out for Leave for 3 years, which is bad to Mr. Jimmy side. also Security refused to allow her in when she went there... so to translate Abscondment is hard, if she will go for CMA she will be in a good position while we will use much energy to defend our Client. it is better to pay the 486,000/- which is not much for her. '),
(25, 17, 2, 3, '2016-10-31 12:10:00', '<p>6 Steps You Need to Take Before Terminating an Employee for Poor Performance</p>\r\n\r\n<p>By: <a href=\"https://www.insperity.com/blog/6-steps-you-need-to-take-before-terminating-an-employee-for-poor-performance/#author-module\">Dawn Motsiff</a> &nbsp;|&nbsp; <a href=\"https://www.insperity.com/blog/6-steps-you-need-to-take-before-terminating-an-employee-for-poor-performance/#comments\"> Comments: 2</a></p>\r\n\r\n<p>Imagine you&rsquo;ve recruited an employee who, for all intents and purposes, seemed competent enough.</p>\r\n\r\n<p>At least, that&rsquo;s what you thought when you hired him.</p>\r\n\r\n<p>But over the last few months, you&rsquo;ve noticed that he is just not performing up to the standard you were expecting. Maybe he&rsquo;s missing deadlines, turning in incomplete reports or just isn&rsquo;t &ldquo;getting it&rdquo;.</p>\r\n\r\n<p>You need to do something. You don&rsquo;t have time to babysit, and constant errors are affecting your team&rsquo;s credibility. You see nothing else to do, but let him go.</p>\r\n\r\n<p>But terminating an employee on a whim can be a risky move for your business. You need a practical and fair process help reduce your liability. Moreover, it&rsquo;s best to give employees plenty of time to improve, and give them the tools needed to get there. After all, <a href=\"https://www.insperity.com/blog/professional-recruiters-reveal-16-of-the-best-interview-questions-to-ask\" target=\"_blank\">recruiting, hiring, onboarding and training a new employee</a> can be very costly.</p>\r\n\r\n<p>But when all else fails, termination may be necessary. In these cases, it&rsquo;s best-practice to follow a progressive discipline process &ndash; which generally includes a series of increasingly severe penalties for repeated offenses &ndash; if you want to conduct performance-based terminations the right way.</p>\r\n\r\n<p>Here are a few things to keep in mind before you get to that step.</p>\r\n\r\n<p>1. Write down everything</p>\r\n\r\n<p>Documentation is key. If you don&rsquo;t write something down, it can be argued that it didn&rsquo;t happen. Even informal conversations written in a notebook can be helpful and count toward documentation.</p>\r\n\r\n<p>I know what you&rsquo;re thinking &ndash; documentation takes time. Time you don&rsquo;t have. Nonetheless, it can be your friend should you have to defend your decision.</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, '<p>2. Clearly communicate expectations</p>\r\n\r\n<p>Let&rsquo;s start at the very beginning.</p>\r\n\r\n<p>For every job, you should have a <a href=\"https://www.insperity.com/blog/4-ways-to-instantly-improve-your-job-descriptions\" target=\"_blank\">job description</a>. Even if you don&rsquo;t have anything formalized, you should have a solid understanding of the functions and responsibilities of each role on your team. You should also know what it takes for employees to be successful in each role.</p>\r\n\r\n<p>And it&rsquo;s essential that your employees know this, too.</p>\r\n\r\n<p>Don&rsquo;t assume. People come with their own perspectives that don&rsquo;t always match their boss&rsquo;. Each role should be clearly defined. This makes it easier to pinpoint and correct problems.</p>\r\n'),
