(40, 10, 31, 5, '2016-11-11 12:11:00', '<p>Today was the SUNSHINE INDUSTRIAL HR CONSULTATION DAY,&nbsp;</p>\r\n\r\n<p>I went there early in the Morning for the Preparation of the Contracts, it was already prepared and given to Ms. Laura. But she return them back to me saying i should give back to her monday but also i should crosscheck everythings to be sure.&nbsp;</p>\r\n\r\n<p>Together with all things, i have prepared Warning letter to the Employee&#39;s name &nbsp;KIDASI, Whose bos complained he left her at the Bank while he was supposed to wat there.&nbsp;</p>\r\n\r\n<p>IN THE OFFICE</p>\r\n\r\n<p>I had the Accountants candidates Interview, which i have qualified all, since have much knowledge on accounts and have good experience,&nbsp;</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, ''),
(41, 10, 31, 5, '2016-11-11 12:11:00', '<p>Today was the SUNSHINE INDUSTRIAL HR CONSULTATION DAY,&nbsp;</p>\r\n\r\n<p>I went there early in the Morning for the Preparation of the Contracts, it was already prepared and given to Ms. Laura. But she return them back to me saying i should give back to her monday but also i should crosscheck everythings to be sure.&nbsp;</p>\r\n\r\n<p>Together with all things, i have prepared Warning letter to the Employee&#39;s name &nbsp;KIDASI, Whose bos complained he left her at the Bank while he was supposed to wat there.&nbsp;</p>\r\n\r\n<p>IN THE OFFICE</p>\r\n\r\n<p>I had the Accountants candidates Interview, which i have qualified all, since have much knowledge on accounts and have good experience,&nbsp;</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, ''),
(42, 10, 31, 5, '2016-11-15 12:11:00', '<p>I VISITED SUNSHINE INDUSTRIAL AND SPRING CITY.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. AT SUNSHINE INDUSTRIAL</p>\r\n\r\n<p>I went to submit internal Memo concerning the informatio to increase salary lf four employees, which is received by Ms. Laura, and She said she will prepare Salary increase Form that shuld be used in the Future.</p>\r\n\r\n<p>I also Given them New contracts, and Ms, Laura said she will sign and after that, she will inform me to give employees to sign on their side, with wich now i have finished first stage of the renewal of the contract, remained is to Administrate Emloyees side to sign.</p>\r\n\r\n<p>There are some changes in Human Resources Management, i have been given Today, that, I should not communicate directly to the Sales Department, insteady all maters should be communicated through Ms. Laura through Official letters, and we have agreed that it will start immediately. Also if Employees have something, they should communicate to Laura and not me, that if they see the matter is okay Laura will inform me what to do.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>AT THE SPRING CITY</p>\r\n\r\n<p>I Passed there to know how are they doing, and become knowing that, there is Retrenchment sugested by Mr. Maganga, that needs to be done, and Mr. Oscar sent us list of employees so that e can help them to calculate their Terminal Benefits, it is not done yet on our side.&nbsp;</p>\r\n\r\n<p>About Mr. Almas who said to refuse to sign the Warning letter he agreed to sign, but i have adviced them that, they are not supposed to force some body to sign a warning letter, since if he refuse there is disciplinary meeting that will decide on the matter against employee.&nbsp;</p>\r\n\r\n<p>About Three terminated employees, Can the office Advice Mr. Maganga to give them NOTICE AND SEVERANCE? &nbsp;to settle the matter, because they said if we dont give them that they intended to continue with the matter at CMA, whith which they require a total of 200 months compensation of unfair termination.</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, '<p>Just i would like to advice of request the office to Advice Mr. Maganga, not to use too much energy to force some matters to be decided befor making any official procedures, because some matters may be solved on the right way but since Mr. Maganga want to do the mater immediately it become unfair. This is the reuest from Mr. Jesse and Oscar.</p>\r\n\r\n<p>They request that, if Employee has misconducted, al the matters should be left to the department, if They want to terminate, then to leave them to organise a best way to terminate inorder to avoid future problems against the company.&nbsp;</p>\r\n'),
(43, 10, 31, 5, '2016-11-15 12:11:00', '<p>I VISITED SUNSHINE INDUSTRIAL AND SPRING CITY.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. AT SUNSHINE INDUSTRIAL</p>\r\n\r\n<p>I went to submit internal Memo concerning the informatio to increase salary lf four employees, which is received by Ms. Laura, and She said she will prepare Salary increase Form that shuld be used in the Future.</p>\r\n\r\n<p>I also Given them New contracts, and Ms, Laura said she will sign and after that, she will inform me to give employees to sign on their side, with wich now i have finished first stage of the renewal of the contract, remained is to Administrate Emloyees side to sign.</p>\r\n\r\n<p>There are some changes in Human Resources Management, i have been given Today, that, I should not communicate directly to the Sales Department, insteady all maters should be communicated through Ms. Laura through Official letters, and we have agreed that it will start immediately. Also if Employees have something, they should communicate to Laura and not me, that if they see the matter is okay Laura will inform me what to do.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>AT THE SPRING CITY</p>\r\n\r\n<p>I Passed there to know how are they doing, and become knowing that, there is Retrenchment sugested by Mr. Maganga, that needs to be done, and Mr. Oscar sent us list of employees so that e can help them to calculate their Terminal Benefits, it is not done yet on our side.&nbsp;</p>\r\n\r\n<p>About Mr. Almas who said to refuse to sign the Warning letter he agreed to sign, but i have adviced them that, they are not supposed to force some body to sign a warning letter, since if he refuse there is disciplinary meeting that will decide on the matter against employee.&nbsp;</p>\r\n\r\n<p>About Three terminated employees, Can the office Advice Mr. Maganga to give them NOTICE AND SEVERANCE? &nbsp;to settle the matter, because they said if we dont give them that they intended to continue with the matter at CMA, whith which they require a total of 200 months compensation of unfair termination.</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, '<p>Just i would like to advice of request the office to Advice Mr. Maganga, not to use too much energy to force some matters to be decided befor making any official procedures, because some matters may be solved on the right way but since Mr. Maganga want to do the mater immediately it become unfair. This is the reuest from Mr. Jesse and Oscar.</p>\r\n\r\n<p>They request that, if Employee has misconducted, al the matters should be left to the department, if They want to terminate, then to leave them to organise a best way to terminate inorder to avoid future problems against the company.&nbsp;</p>\r\n'),
(44, 10, 31, 5, '2016-11-18 12:11:00', '<p>STAR WAY VISITING REPORT</p>\r\n\r\n<p>I went to Starway and meet with Mr. Gasper Jonah, we discussed many thing and reviewing documents and his HR arrancements.</p>\r\n\r\n<p>All arrangements are in a good line, he arranged well, and even the employee list also arranged well, but he adviced something on how to handle employees.&nbsp;</p>\r\n\r\n<p>1. TUICO we have to discourage TUICO to register new members in the company, since these TUICO are the one who are source of many problems in workplaces. it is said they give to Employees 10,000 inorder for them to join TUICO which is very wrong.&nbsp;</p>\r\n\r\n<p>2. PPF have been regidtered 4 employees until no, but employees do not want PPF they want LAPF which they can take their money after finishing the employment relationship, or terminating the contract, I have adviced him to talk to the management so that they ill invite LAPF</p>\r\n\r\n<p>3. We Discussed about the Working hours, he said people are working more that the normal working hours, but the STAR WAY are not interested to pay Overtime payment, another are working nightshift, so he will advice them that, we should avoid working overtime so that we can be on the good position to avoid problems.&nbsp;</p>\r\n\r\n<p>4. Lunch time is 30minutes which are not enough, it is adviced atleast 1hour, so i would lik to office to talk to the Bos so that they may provide 1 hour of lunch to the employees.&nbsp;</p>\r\n\r\n<p>5. Employees are working during holidays but not paid double payments,&nbsp;</p>\r\n\r\n<p>6. Issue of giving them safety gears is important, especialy Respiratory, overlory, boot, and helment</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ONTOP OF THOSE ISSUES</p>\r\n\r\n<p>He requested some samples of the following documents:&nbsp;</p>\r\n\r\n<p>1. HR policy (HR Manual)</p>\r\n\r\n<p>2. Rules and Regulations</p>\r\n\r\n<p>3. Sexcual harasment policy&nbsp;</p>\r\n\r\n<p>4. HIV and AIDs Policy&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>That were requested by the Labour officers who will pass there after sometimes, so he insisted that, if we have sample we can send it to him so that, he can prepare for the starway company.&nbsp;</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, '<p>Concernig the sharing with food in the China Canteen, he said it is okay he will not share again, he himself said he felt bad while treated hib badly first day, while he was invited by their fellow employee to go there.&nbsp;</p>\r\n\r\n<p>Since then he have never gone there again. Mr, Gaspel seems to be confortable with the environment.&nbsp;</p>\r\n'),
