(62, 10, 31, 5, '2017-01-14 12:01:00', '<p>SUNSHINE INDUSTRIAL ISSUES</p>\r\n\r\n<p>1. ANETH KIYOGOMO&nbsp;</p>\r\n\r\n<p>The Sunshine Industrial Management proposed to Terminate her Contract because she is now Pregnant, We had meeting Yesterday on 13th January 2017, concerning the issue and Adviced them, to use End of contract reason and not Pregnancy. this is because i know the effects for terminating some one because of pregnaancy. We agreed that, i should all the Lady to my office and give her information, that she should have annual leave until february 16, which she refused, and she said she needs to be given all required Terminal Benefits for the Termination of Contract with her Last year remained Days for annual Leave.</p>\r\n\r\n<p>I will discuss with Sunshine Management concerning the matter, since we should make things careful to avoid any distubance or case, concerning unfear termination</p>\r\n\r\n<p>2. There are Three Employees who requested LEAVE but they nevereturned to work until now.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; A) Emmanuel Nyakyoma requested for unpaid leave since Novmber 2016, and he didn&#39;t return to work until today, despite the efforts to call him to ask to report to work.</p>\r\n\r\n<p>&nbsp; &nbsp;B) Christopher Malango, asked 3 days to take care for his mother who is sick, i talk to one of his guarantors, She told me that His mother is in Critical condition in the Hosptal, so the condition is not good until now, i am still following up to confirm the information he gave to me.</p>\r\n\r\n<p>&nbsp; C) Boniface Msofe he requested for leave last year November, he said he was sick, but until now he never reported to the office neither receiving calls nor calling us informing why he never retuning to work. i have tried to call him but he dot receive the telephone call.&nbsp;</p>\r\n\r\n<p>So For Mr. Boniface i have sent him a Show course letter, since the Management have decided to terminate him, due to His Abscondment, and Other Two people &nbsp;i am following up information then will discuss with management about what to du.</p>\r\n\r\n<p>with Regards&nbsp;</p>\r\n\r\n<p>Silvanus Mumba</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, '<p>We need to advice our Client issue for Terminating people especialy ladies after geting Pregnanct, this is prohibitd by the Law, atleast if they know they will not order HR to terminate people basing on such reason.&nbsp;</p>\r\n'),
(63, 10, 31, 5, '2017-01-14 12:01:00', '<p>SUNSHINE INDUSTRIAL ISSUES</p>\r\n\r\n<p>1. ANETH KIYOGOMO&nbsp;</p>\r\n\r\n<p>The Sunshine Industrial Management proposed to Terminate her Contract because she is now Pregnant, We had meeting Yesterday on 13th January 2017, concerning the issue and Adviced them, to use End of contract reason and not Pregnancy. this is because i know the effects for terminating some one because of pregnaancy. We agreed that, i should all the Lady to my office and give her information, that she should have annual leave until february 16, which she refused, and she said she needs to be given all required Terminal Benefits for the Termination of Contract with her Last year remained Days for annual Leave.</p>\r\n\r\n<p>I will discuss with Sunshine Management concerning the matter, since we should make things careful to avoid any distubance or case, concerning unfear termination</p>\r\n\r\n<p>2. There are Three Employees who requested LEAVE but they nevereturned to work until now.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; A) Emmanuel Nyakyoma requested for unpaid leave since Novmber 2016, and he didn&#39;t return to work until today, despite the efforts to call him to ask to report to work.</p>\r\n\r\n<p>&nbsp; &nbsp;B) Christopher Malango, asked 3 days to take care for his mother who is sick, i talk to one of his guarantors, She told me that His mother is in Critical condition in the Hosptal, so the condition is not good until now, i am still following up to confirm the information he gave to me.</p>\r\n\r\n<p>&nbsp; C) Boniface Msofe he requested for leave last year November, he said he was sick, but until now he never reported to the office neither receiving calls nor calling us informing why he never retuning to work. i have tried to call him but he dot receive the telephone call.&nbsp;</p>\r\n\r\n<p>So For Mr. Boniface i have sent him a Show course letter, since the Management have decided to terminate him, due to His Abscondment, and Other Two peo