(64, 10, 31, 5, '2017-02-02 12:02:00', '<p><strong><u>REPORT FOR THE HONGWEI INTERNATIONAL CO LTD.</u></strong></p>\r\n\r\n<p>Prepared by: Silvanus C. Mumba</p>\r\n\r\n<p>Vipajilink HR consultant</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Robbery issue happened on 27th January 2017 at 2:00am night</p>\r\n\r\n<p><strong><u>INTRODUCTION</u></strong></p>\r\n\r\n<p>The Robbery incident that, caused me to have an emergent business trip to Mafinga, which caused go to Mbeya meeting the OSHA officers to report the incident.</p>\r\n\r\n<p>The Issue happened on 27th January 2017 at 2:00am night that caused some injuries and loss of the company and other employee&rsquo;s properties. I went there to perform some Human resources related issues and to meet with DC with the OCD to see how they can help to catch those involved on the maters.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><u>INCIDENT </u></strong></p>\r\n\r\n<p>There were six people who attacked the factory in Mafinga Hongwey International Co ltd, where three people were injury and one Chinese person badly injured on the Head.</p>\r\n\r\n<p><strong>Employee&rsquo;s witnesses </strong></p>\r\n\r\n<p>One Employee Said, He saw somebody name William, whom he got a certain problem with his supervisor. Mr. William fought with his fellow Employee who is Woman, and injured her badly, so their Supervisor suspended him so as to wait for the office Decision while they are waiting for Mr. Kamgisha.</p>\r\n\r\n<p>Mr. William has been sending intimidating sms to the Chinese Supervisor and his fellow employee that, he needs some money if not he will do something bad to the Chinese and Other employees.</p>\r\n\r\n<p>Together with William there were Superdoll and Turbo, Were involve together with other 3 unknown villagers are the one who attacked the factory.</p>\r\n\r\n<p>Also Superdoll and Turbo involved on the theft of the company Generator, where they were fired because of the theft matter. This is why they joined together to revenge.</p>\r\n\r\n<p>When entering the factory, Mr. William ware company&rsquo;s work jacket that is given as the company uniform, also Superdoll ware cloth that he ware it in the morning, and this is why was easy to identify them.</p>\r\n\r\n<p><strong>Information from OCD </strong></p>\r\n\r\n<p>The investigation is continues, and all people been tracked they are at Mafinga and they promise to catch them and send them to court.</p>\r\n\r\n<p>The OC-CID took all sms sent by Mr. William to be used as Evidence for the case. And he promised to do his level best to arrest them.</p>\r\n\r\n<p><strong>OSHA</strong></p>\r\n\r\n<p>I have reported the incident but the OSHA form is just information of the serious injured person who is a Chinese, We write all statement and attached is to the OSHA Office in Mbeya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Other Issues about the Factory</strong></p>\r\n\r\n<p>They have an issue with the TRA Income tax calculations and payments, and the TRA district Manager visited there several times to insist them about the payments, so now their Admin Mr. Kamgisha who is also Translator asked us to advice them to make all arrangements to pay those taxes which they mentioned here.</p>\r\n\r\n<p>SDL</p>\r\n\r\n<p>Provision tax</p>\r\n\r\n<p>Value Added Tax</p>\r\n\r\n<p>So for other things are done as I was requested to do by the office, but about the TAX issue is not my profession, I would like to ask the proper department to give them advice on how to arrange as requested.</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, ''),
(65, 10, 31, 5, '2017-02-02 12:02:00', '<p><strong><u>REPORT FOR THE HONGWEI INTERNATIONAL CO LTD.</u></strong></p>\r\n\r\n<p>Prepared by: Silvanus C. Mumba</p>\r\n\r\n<p>Vipajilink HR consultant</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Robbery issue happened on 27th January 2017 at 2:00am night</p>\r\n\r\n<p><strong><u>INTRODUCTION</u></strong></p>\r\n\r\n<p>The Robbery incident that, caused me to have an emergent business trip to Mafinga, which caused go to Mbeya meeting the OSHA officers to report the incident.</p>\r\n\r\n<p>The Issue happened on 27th January 2017 at 2:00am night that caused some injuries and loss of the company and other employee&rsquo;s properties. I went there to perform some Human resources related issues and to meet with DC with the OCD to see how they can help to catch those involved on the maters.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><u>INCIDENT </u></strong></p>\r\n\r\n<p>There were six people who attacked the factory in Mafinga Hongwey International Co ltd, where three people were injury and one Chinese person badly injured on the Head.</p>\r\n\r\n<p><strong>Employee&rsquo;s witnesses </strong></p>\r\n\r\n<p>One Employee Said, He saw somebody name William, whom he got a certain problem with his supervisor. Mr. William fought with his fellow Employee who is Woman, and injured her badly, so their Supervisor suspended him so as to wait for the office Decision while they are waiting for Mr. Kamgisha.</p>\r\n\r\n<p>Mr. William has been sending intimidating sms to the Chinese Supervisor and his fellow employee that, he needs some money if not he will do something bad to the Chinese and Other employees.</p>\r\n\r\n<p>Together with William there were Superdoll and Turbo, Were involve together with other 3 unknown villagers are the one who attacked the factory.</p>\r\n\r\n<p>Also Superdoll and Turbo involved on the theft of the company Generator, where they were fired because of the theft matter. This is why they joined together to revenge.</p>\r\n\r\n<p>When entering the factory, Mr. William ware company&rsquo;s work jacket that is given as the company uniform, also Superdoll ware cloth that he ware it in the morning, and this is why was easy to identify them.</p>\r\n\r\n<p><strong>Information from OCD </strong></p>\r\n\r\n<p>The investigation is continues, and all people been tracked they are at Mafinga and they promise to catch them and send them to court.</p>\r\n\r\n<p>The OC-CID took all sms sent by Mr. William to be used as Evidence for the case. And he promised to do his level best to arrest them.</p>\r\n\r\n<p><strong>OSHA</strong></p>\r\n\r\n<p>I have reported the incident but the OSHA form is just information of the serious injured person who is a Chinese, We write all statement and attached is to the OSHA Office in Mbeya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Other Issues about the Factory</strong></p>\r\n\r\n<p>They have an issue with the TRA Income tax calculations and payments, and the TRA district Manager visited there several times to insist them about the payments, so now their Admin Mr. Kamgisha who is also Translator asked us to advice them to make all arrangements to pay those taxes which they mentioned here.</p>\r\n\r\n<p>SDL</p>\r\n\r\n<p>Provision tax</p>\r\n\r\n<p>Value Added Tax</p>\r\n\r\n<p>So for other things are done as I was requested to do by the office, but about the TAX issue is not my profession, I would like to ask the proper department to give them advice on how to arrange as requested.</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, ''),
(66, 1, 2, 3, '2017-02-10 12:02:00', '<p>string</p>\r\n\r\n<p>The header string.</p>\r\n\r\n<p>There are two special-case header calls. The first is a header that starts with the string &quot;<em>HTTP/</em>&quot; (case is not significant), which will be used to figure out the HTTP status code to send. For example, if you have configured Apache to use a PHP script to handle requests for missing files (using the <em>ErrorDocument</em> directive), you may want to make sure that your script generates the proper status code.</p>\r\n\r\n<p>&lt;?php<br />\r\nheader(&quot;HTTP/1.0&nbsp;404&nbsp;Not&nbsp;Found&quot;);<br />\r\n?&gt;</p>\r\n\r\n<p>The second special case is the &quot;Location:&quot; header. Not only does it send this header back to the browser, but it also returns a <em>REDIRECT</em> (302) status code to the browser unless the <em>201</em> or a <em>3xx</em> status code has already been set.</p>\r\n\r\n<p>&lt;?php<br />\r\nheader(&quot;Location:&nbsp;http://www.example.com/&quot;);&nbsp;/*&nbsp;Redirect&nbsp;browser&nbsp;*/<br />\r\n<br />\r\n/*&nbsp;Make&nbsp;sure&nbsp;that&nbsp;code&nbsp;below&nbsp;does&nbsp;not&nbsp;get&nbsp;executed&nbsp;when&nbsp;we&nbsp;redirect.&nbsp;*/<br />\r\nexit;<br />\r\n?&gt;</p>\r\n\r\n<p>replace</p>\r\n\r\n<p>The optional replace parameter indicates whether the header should replace a previous similar header, or add a second header of the same type. By default it will replace, but if you pass in <strong>FALSE</strong> as the second argument you can force multiple headers of the same type. For example:</p>\r\n\r\n<p>&lt;?php<br />\r\nheader(&#39;WWW-Authenticate:&nbsp;Negotiate&#39;);<br />\r\nheader(&#39;WWW-Authenticate:&nbsp;NTLM&#39;,&nbsp;false);<br />\r\n?&gt;</p>\r\n\r\n<p>http_response_code</p>\r\n\r\n<p>Forces the HTTP response code to the specified value. Note that this parameter only has an effect if the string is not empty.</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, ''),
(67, 1, 2, 3, '2017-02-10 12:02:00', '<p>string</p>\r\n\r\n<p>The header string.</p>\r\n\r\n<p>There are two special-case header calls. The first is a header that starts with the string &quot;<em>HTTP/</em>&quot; (case is not significant), which will be used to figure out the HTTP status code to send. For example, if you have configured Apache to use a PHP script to handle requests for missing files (using the <em>ErrorDocument</em> directive), you may want to make sure that your script generates the proper status code.</p>\r\n\r\n<p>&lt;?php<br />\r\nheader(&quot;HTTP/1.0&nbsp;404&nbsp;Not&nbsp;Found&quot;);<br />\r\n?&gt;</p>\r\n\r\n<p>The second special case is the &quot;Location:&quot; header. Not only does it send this header back to the browser, but it also returns a <em>REDIRECT</em> (302) status code to the browser unless the <em>201</em> or a <em>3xx</em> status code has already been set.</p>\r\n\r\n<p>&lt;?php<br />\r\nheader(&quot;Location:&nbsp;http://www.example.com/&quot;);&nbsp;/*&nbsp;Redirect&nbsp;browser&nbsp;*/<br />\r\n<br />\r\n/*&nbsp;Make&nbsp;sure&nbsp;that&nbsp;code&nbsp;below&nbsp;does&nbsp;not&nbsp;get&nbsp;executed&nbsp;when&nbsp;we&nbsp;redirect.&nbsp;*/<br />\r\nexit;<br />\r\n?&gt;</p>\r\n\r\n<p>replace</p>\r\n\r\n<p>The optional replace parameter indicates whether the header should replace a previous similar header, or add a second header of the same type. By default it will replace, but if you pass in <strong>FALSE</strong> as the second argument you can force multiple headers of the same type. For example:</p>\r\n\r\n<p>&lt;?php<br />\r\nheader(&#39;WWW-Authenticate:&nbsp;Negotiate&#39;);<br />\r\nheader(&#39;WWW-Authenticate:&nbsp;NTLM&#39;,&nbsp;false);<br />\r\n?&gt;</p>\r\n\r\n<p>http_response_code</p>\r\n\r\n<p>Forces the HTTP response code to the specified value. Note that this parameter only has an effect if the string is not empty.</p>\r\n', 0, 0, 0, 0, 0, 0, 0, 0, 0, ''),
(85, 10, 31, 5, '2017-02-24 00:00:00', 'I wet to Sunshine Industrial to get informations about some Issues. \r\n1. About Mr. Chacha John Mwita\r\n2. Proposed changes in Timing for One Employee (Sweetbert Pius)\r\n\r\n1. About Chacha\r\nMr. Chacha was Missing for 4 Days since 20th February without prio notifications, We all together Between Head of Sales Department (Mr. Krishna), and His Boss Tried to find him without success. \r\nToday on 24th He come with the reason that, he and his Brother was Robbed that caused his brother\'s Death, on that insidence he lost conscious for two hours and regained after he was admitted at Temeke Hospital. So they lost all telephones and other office communications and this is why he didnt inform the office until they finished bureau ceremony of his brother. \r\n\r\nSo His Boss asked me to Make all procedures required before Advising them to things to do.\r\n1. I want to visit the place where incident happened so as to ask those people whether the incident happened true. \r\n2. I want to visit the Police station to get conformation about the RB number and whether there is a reported incident like this. \r\n3. I will come with the report that will give us a picture whether what he say is true or not, so that i can give them a rational advice. \r\n\r\nAbout the Proposed Changes\r\nMr. Sweetbert started to work theere on 30 Jan 2017, which is shown in their Attendance, But on that Day he was sent to make Police Clerance, where they say, they dont count as a working day for him because he was not in the office. so now we will count as 22 Days for this Month. \r\n\r\nI have oppened filles and arrange the cabinet in a proper manner, now every things are in the good order. the remained is o update the HR system. ', 0, 0, 0, 0, 0, 0, 0, 0, 0, '');
